CREATE DEFINER=`root`@`localhost` PROCEDURE `CalcularProyeccionIntervaloSoles`(IN FechaInicio DATE, IN FechaFin DATE)
BEGIN
	DECLARE Monto FLOAT;
	SELECT SUM(PG.Monto) FROM pagos PG INNER JOIN contratos CNT ON PG.idContrato = CNT.idContrato  WHERE  idMoneda = 2 AND (PG.idEstadoDePago = 2 OR PG.idEstadoDePago=3) AND (FechaInicio < PG.FechaDePago   AND PG.FechaDePago < FechaFin);
END ;;
